import React, { useState, useEffect } from "react";
import { API } from "../api";
import JournalForm from "../components/JournalForm";
import EmotionChart from "../components/EmotionChart";
import EntryList from "../components/EntryList";

export default function Dashboard() {
  const [entries, setEntries] = useState([]);

  useEffect(() => {
    API.get("/get_entries").then((res) => setEntries(res.data));
  }, []);

  const addEntry = (entry) => setEntries([...entries, entry]);

  return (
    <div className="min-h-screen flex flex-col items-center py-10 space-y-8">
      <h1 className="text-4xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-indigo-600 to-pink-500 flex items-center gap-3">
        ðŸ§  AI Emotion Journal
      </h1>
      <p className="text-gray-600">
        Track your daily emotions with AI-powered sentiment analysis ðŸ’«
      </p>

      <div className="flex flex-col items-center gap-8 w-full px-4">
        <JournalForm onNewEntry={addEntry} />
        <EmotionChart entries={entries} />
        <EntryList entries={entries} />
      </div>
    </div>
  );
}
